import React from 'react';

function MyAccount(props) {
  const { user } = props;

  return (
    <div className="my-account">
      <h2>My Account</h2>
      <p>Username: {user.username}</p>
      <p>Email: {user.email}</p>
      <p>Image: {user.image}</p>
    </div>
  );
}

export default MyAccount;
